window.bookSummaryJSON = "<p><b>An evil plot throws the Eight Wizardoms into chaos. Heroes old and new assemble to combat this daunting threat. Thirty-plus hours of adventure, intrigue, and witty banter!</b></p> <p>Rebellion, war, and toppled thrones ravage the Eight Wizardoms.</p> <p>The mysterious leader of a secret organization seeks to wreak chaos, death, and destruction. What motivates his elaborate scheme? What is his end-game?</p> <p>A squad of unlikely heroes armed with magical objects are drawn into the conflict:</p> <p></p> <ul> <li>Jerrell \"Jace\" - A clever thief with a flair for the outrageous.</li> <li>Narine - A wizardess, queen, and bride...pursued by assassins.</li> <li>Harlequin - This female pirate wields sabers, a whip, and a sharp tongue.</li> <li>Crusser - This lifelong soldier has a big heart and a terrible temper.</li> <li>Brogan - A retired warrior burdened by lifelong regrets.</li> <li>Blythe - She wields an enchanted bow that forever altered her appearance.</li> </ul> <p>These characters lead a compelling and memorable cast in a tale that brings the eight wizardoms to the brink of devastation.</p> <p>Fall of Wizardoms is an epic fantasy spectacle, filled with action, intrigue, and compelling characters and is told by the acclaimed narrator, Travis Baldree.</p> <p>Download and prepare for a spectacular, thrilling adventure.</p> <p>This boxed set includes:</p> <p></p> <ol> <li><i>God King Rising</i></li> <li><i>Legend of the Sky Sword</i></li> <li><i>Curse of the Elf Queen</i></li> </ol> <p>Other books in the Fall of Wizardoms series:</p> <p></p> <ul> <li><i>Shadow of a Dragon Priest</i></li> <li><i>Advent of the Drow</i></li> <li><i>A Sundered Realm</i></li> </ul>"; 
